import Logo2 from "../../../assets/img2.png";
import { ThemeDiv, ThemeHeader } from "./style";
import { FiMenu } from "react-icons/fi";

const HeaderModal = ({ closeModal }) => {
  return (
    <>
      <ThemeHeader w="100%" h="100px" bc="#68DAD8" j="space-between" a="center">
        <img src={Logo2} alt="Logo" />
        <FiMenu onClick={() => closeModal} className="button1" />
      </ThemeHeader>
      <ThemeDiv>
        <ThemeDiv a="center">
          <img src="" alt="Home" /> <h2>Home</h2>
        </ThemeDiv>
        <ThemeDiv>
          <img src="" alt="Login" /> <h2>Login</h2>
        </ThemeDiv>
        <ThemeDiv>
          <img src="" alt="Cadasstr" /> <h2>Cadastrar escola</h2>
        </ThemeDiv>
        <ThemeDiv>
          <img src="" alt="Eventtos" /> <h2>Eventos</h2>
        </ThemeDiv>
        <ThemeDiv>
          <img src="" alt="Emaill p" /> <h2>Email para contato</h2>
        </ThemeDiv>
      </ThemeDiv>
    </>
  );
};

export default HeaderModal;
